Pornocopia (Zero Tolerance / Split Scenes / **NEW** / 2014)

The masterminds at America's dirtiest comedy shop, Woodrocket, have been working long and hard making X-rated versions of the ost unlikely subjects of pop culture. Now Zero Tolerance has collected the cream of their parody crop of this unforgettable collection of hardcore hits that just keep coming, including many scenes that have never been seen by the naked eye. Find out what millions of on-line prevs and comedy connoisseurs already know, that Woodrocket is fucking funny! 

Chloe Addison, Dani Jensen, Veruca James, Violet Monroe, Gaia, Aiden Starr, Anthony Rosano, James Deen, Tommy Pistol, Dick Chibbles

Parody, Comedy, Cosplay, Vignettes

